import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Home from './Home';
import About from './About';
import ServicePage from './ServicePage';

function Header() {
  const [fetchedComponent, setFetchedComponent] = useState(null);

  const handleComponentChange = (componentName) => {
    fetch(`/get_component/${componentName}`)
      .then((response) => response.json())
      .then((data) => {
        const { component } = data;
        if (component) {
          console.log(`Rendering ${component}`);
          setFetchedComponent(component); // Save the fetched component data
        }
      })
      .catch((error) => {
        console.error('Error fetching component data:', error);
      });
  };

  useEffect(() => {
    // Trigger a re-render when fetchedComponent changes
    switch (fetchedComponent) {
      case 'HomeComponent':
        return <Home />;
      case 'AboutComponent':
        return <About />;
      case 'ServicesComponent':
        return <ServicePage />;
      default:
        return null;
    }
  }, [fetchedComponent]);

  return (
    <header className="bg-dark">
      <nav className="navbar navbar-expand-lg navbar-dark">
        {/* Your navigation elements */}
        <Link to="/" className="navbar-brand">Your Brand</Link>
        <ul className="navbar-nav">
          <link className="nav-link"><a href="/">Home</a></link>
          <link className="nav-link"><a href="/about">About</a></link>
          <link className="nav-link"><a href="/services">Services</a></link>
        </ul>
        <div>
          {/* Render the fetched component */}
          {fetchedComponent}
        </div>
      </nav>
    </header>
  );
}

export default Header;
